import React from 'react';
import Flip from './flip';
import Title from '../title';

const flip = [
  { title: 'Tráfego pago', text: 'Conteúdo do Card 1' },
  { title: 'Topo das pesquisas', text: 'Conteúdo do Card 2' },
];
const flip2 = [
  { title: 'Whatsapp business', text: 'Conteúdo do Card 3' },
  { title: 'Website moderno', text: 'Conteúdo do Card 3' },
];
export default function Fliper() {
  return (
    <section className=" h-[100%] flex z-1 items-center pt-[46px]  flex-col bg-fuchsia-950">
      <Title title={'Qual a sua necessidade ?'} />
      <div className=" flex max-w-7xl items-center  grid-cols-4 gap-[40px] flex-row">
        <div className="  flex items-center mb-[32px] gap-[40px] flex-row ">
          {flip.map((card, index) => (
            <Flip key={index} title={card.title} text={card.text} />
          ))}
        </div>
        <div className="  flex items-center mb-[32px] gap-[40px] flex-row ">
          {flip2.map((card, index) => (
            <Flip key={index} title={card.title} text={card.text} />
          ))}
        </div>
      </div>
    </section>
  );
}
